import { LOGIN__FORM } from '../constants/actionTypes';
import { axios } from 'axios';

export const loginAction = value => async dispatch => {
  try {
    dispatch({
      type: LOGIN__FORM,
      payload: value
    });
  } catch (error) {
    console.log(error);
  }
};
